import Layout from '../components/MyLayout';
import Header from '../components/Header';
import Link from 'next/link';

export default function Blog() {
  return (
    <Layout>
      <div className="container">
        <div className="info">
          <img src='/me.png'/>
        </div>
      </div>
      <style jsx>{`
        .container {
          height: 100vh;
          background: gray;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .info {
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .info img {
          border-radius: 50%;
        }

        h1,
        a {
          font-family: 'Arial';
        }
      `}</style>
    </Layout>
  );
}
